import React from "react";
import { Route, Routes } from "react-router-dom";

import Home from './home'

const RoutesMain = () => {
    return (
        <Routes>
            <Route exact path="/home">
                <Home></Home>
            </Route>
        </Routes>
    )
}

export default RoutesMain;
